package gio.hobist.Service;

import gio.hobist.Dto.UserDto;
import gio.hobist.Entity.User;
import gio.hobist.Repository.UserRepository;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Service;

import java.util.Base64;
import java.util.UUID;

@Service
public class UserService {
    @Autowired
    private UserRepository userRepository;

    public UserService(UserRepository userRepository) {
        this.userRepository = userRepository;
    }

    public UserDto getCurrentAutenthicatedUser(UUID userId){
       User user= userRepository.findByid(userId);

        return new UserDto(user.getName(),
                null,
                user.getEmail(),
//                Base64.getEncoder().encodeToString(user.getProfileImageRawData()));
                ""
               );//M.G: this string is base64 string used for picture testing at moment

    }
}
